## Tibble grid sampling


::: {.cell}

```{.r .cell-code}
grid <- tibble(
  prob = seq(0.0001, 0.9999, length = 5000), 
  prior_unstd = case_when(
    prob < 0.5 ~ 0,
    .default = 1
  ),
  prior_std = prior_unstd/sum(prior_unstd),
  data = dbinom(6, size = 9, prob = prob),
  posterior_unstd = prior_std * data,
  posterior = posterior_unstd / sum(posterior_unstd)
)
```
:::

::: {.cell}

```{.r .cell-code}
grid |> 
  ggplot(aes(prob, prior_std))+
    geom_line()+
    labs(y = "prior density",
         title = "Prior") -> 
  prior_plot

grid |> 
  ggplot(aes(prob, data))+
    geom_line()+
    labs(y = "data density",
         title = "Data") -> 
  data_plot

grid |> 
  ggplot(aes(prob, posterior))+
    geom_line() +
    labs(y = "posterior density",
         title = "Posterior") -> 
  posterior_plot

prior_plot | data_plot | posterior_plot
```

::: {.cell-output-display}
![Prior, Data, Posterior](index_files/figure-html/fig-posterior1-1.png){#fig-posterior1 width=960}
:::
:::


Sampling from the posterior


::: {.cell}

```{.r .cell-code}
grid |> 
  sample_n(size = 1e4, 
           replace = T,
           weight = posterior)->
  posterior_samples
```
