## BRMS


::: {.cell}

```{.r .cell-code}
library(brms)
```
:::

::: {.cell}

```{.r .cell-code}
tibble(
  water = 6,
  samples = 9
)-> 
  water_to_model
```
:::

::: {.cell}

```{.r .cell-code}
water_form <- bf(
   water | trials(samples) ~ 1,
   family = binomial(link = "identity")
)
```
:::

::: {.cell}

```{.r .cell-code}
brm(
  water | trials(samples) ~ 1,
  data = water_to_model,
  family = binomial(link = "identity"),
  prior(beta(1, 1), class = Intercept, ub = 1, lb = 0),
  file_refit = "on_change",
  file = "water_fit.rds"
) ->
  water_model
```
:::

::: {.cell}

```{.r .cell-code}
water_model
```

